import React from 'react'
import d from './Music.module.css';
import {compose} from "redux";
import {AuthRedirect} from "../hocs/AuthRedirect";
import Modal from "../ModalWindow/Modal";


const Music = (props) => {
  return(
      <Modal isOpen={true}
             title="Hello Title"
             body="Hello Body"
             footer="Hello Footer"
      />
  )
}
export default compose(
    AuthRedirect
)(Music)
